import React from 'react';
import { Link } from 'react-router-dom'
import { Container } from '../CaixaCentral/styled';
import { connect } from 'react-redux'

function CaixaCentral({ dadosPros }) {
  dadosPros
  console.log
  return (
    <Container>
      {dadosPros.map(product => (
        <>
          <h1 class="titulo">{product.nome}</h1>
          <h3 class="descricao">{product.descricao}</h3>
        </>
      ))}
    </Container>
  )
}

const mapStateToProps = state => ({
  dadosPros: state.cart,

})

export default connect(mapStateToProps)(CaixaCentral)
